import React ,{Component}from 'react';
import {StyleSheet, View,Text,Image} from 'react-native';
import TabNavigator from 'react-native-tab-navigator';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';
import ProviderOrder from './Scene/providerOrder.js'
import Account from './Scene/account.js'
import Plan from './Scene/plan.js'

export default function App() {
  const Tab = createBottomTabNavigator();

  return (
    <NavigationContainer>
        <Tab.Navigator>
          <Tab.Screen name="主页" component={ProviderMain} />
          <Tab.Screen name="订单" component={ProviderOrder} />
          <Tab.Screen name="行程" component={Plan} />
          <Tab.Screen name="账户" component={Account} />
        </Tab.Navigator>
    </NavigationContainer>
  );
}
